import React, { Component } from "react";
import { BrowserRouter, Route, NavLink } from "react-router-dom";
import "./App.css";
import SiteNav from "./components/SiteNav";
import Jumbo from "./components/Jumbo";
// import Content from "./components/Content";
import Footer from "./components/Footer";
import Welcome from "./components/Welcome";
import Form from "./components/Form"
import "rc-pagination/assets/index.css";
import LoginRegister from "./components/LoginRegister"

class App extends Component {
  render() {
    return (
      <BrowserRouter>

        <div>
          {/* <Welcome /> */}
          <NavLink to="/">Go Home</NavLink>
          <Route path="/" exact={true} component={Welcome}></Route>
          <Route path="/siteNav" exact={true} component={SiteNav}></Route>
          <Route path="/jumbo" exact={true} component={Jumbo}></Route>
          <Route path="/loginRegister" exact={true} component={LoginRegister}></Route>
        </div>
        <div>
          {/* {<LoginRegister />} */}
          <NavLink to="/LoginRegister">Login or Register</NavLink>

        </div>
        <div>


          {/* <SiteNav /> */}
          <NavLink to="/siteNav">Go to SiteNav</NavLink>
        </div>
        <div>
          {/* <Jumbo /> */}
          <NavLink to="/jumbo">Go to Jumbo</NavLink>
        </div>
        <div>
          {/* <Footer /> */}
          <NavLink to="/footer">Go to Footer</NavLink>
          <Route path="/footer" exact={true} component={Footer}></Route>
        </div>
        <div>
          <NavLink to="/form">Go to Form</NavLink>
          <Route path="/form" exact={true} component={Form}></Route>
        </div>

      </BrowserRouter >
    );
  }
}

export default App;
